<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>documentation for jbcarreon123's projects</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="Description">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/docsify@4/lib/themes/vue.css">
  <script src="https://cdn.jsdelivr.net/npm/docsify/lib/docsify.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/docsify-copy-code/dist/docsify-copy-code.min.js"></script>
  <link rel="stylesheet" href="https://unpkg.com/docsify-toc@1.0.0/dist/toc.css">
  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=Inconsolata&family=Poppins:wght@300&family=Source+Code+Pro&display=swap" rel="stylesheet">
  <style>
	*:not(.fa) {
      font-family: 'Source Code Pro', monospace, sans-serif !important;
    }
  </style>
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      name: 'documentation for jbcarreon123\'s projects',
      repo: 'https://github.com/jbcarreon123/docs',
	  loadSidebar: true,
	  relativePath: true,
	  pagination: {
	    crossChapter: false,
        crossChapterText: false,
	  },
	  toc: {
		scope: '.markdown-section',
		headings: 'h1, h2, h3, h4, h5, h6',
		title: 'Contents',
	  },
    }
  </script>
  <!-- Docsify v4 -->
  <script src="https://cdn.jsdelivr.net/npm/docsify@4"></script>
  
  <!-- Plugins -->
  <script src="https://unpkg.com/docsify-pagination/dist/docsify-pagination.min.js"></script>
  <script src="https://cdn.jsdelivr.net/npm/@alertbox/docsify-footer/dist/docsify-footer.min.js"></script>
  <link rel="stylesheet" href="https://cdn.jsdelivr.net/gh/sushantrahate/docsify-darkly-theme/css/darkly.css">
  <script src="https://unpkg.com/docsify-toc@1.0.0/dist/toc.js"></script>
  <script
  src="//unpkg.com/@rakutentech/docsify-code-inline/dist/index.min.js"
></script>
  <script src="https://cdn.jsdelivr.net/npm/docsify-terminal-block@1.0.3"></script>
  <script src="https://unpkg.com/docsify-copy-code@2"></script>
  <script src="https://unpkg.com/@h-hg/docsify-image-caption/dist/docsify-image-caption.min.js"></script>
</body>
</html>
